from sklearn.feature_extraction.text import TfidfVectorizer
from sklearn.metrics.pairwise import cosine_similarity
from PIL import Image, ImageChops
from base64 import b64encode, b64decode
from flask import Flask, request
import struct
from matplotlib import colors
from math import floor
import io

app = Flask(__name__)

item_descriptions = [item["description"] for item in dataset["Items"]]
block_descriptions = [block["description"] for block in dataset["Blocks"]]


def find_closest_match(new_description, description_list):
    vectorizer = TfidfVectorizer()
    combined_descriptions = description_list + [new_description]
    tfidf_matrix = vectorizer.fit_transform(combined_descriptions)
    cosine_similarities = cosine_similarity(
        tfidf_matrix[-1], tfidf_matrix[:-1]
    ).flatten()
    closest_match_index = cosine_similarities.argmax()
    return description_list[closest_match_index], closest_match_index


def process_image(image, image2, base_color):
    rotated_image = image.rotate(-45, expand=False)

    background = Image.new("RGBA", rotated_image.size, (0, 0, 0, 0))
    offset = (
        (background.width - rotated_image.width) // 2,
        (background.height - rotated_image.height) // 2,
    )
    centered_image = ImageChops.offset(rotated_image, offset[0], offset[1])
    try:
        datas = centered_image.getdata()
        new_data = []
        for item in datas:
            if item[3] < 255 and item[3] > 0:
                new_data.append((item[0], item[1], item[2], 255))
            else:
                new_data.append(item)
        centered_image.putdata(new_data)
    except:
        print("Error making all pixels opaque")

    newImg = ImageChops.offset(
        image2.rotate(-45, expand=False),
        (
            Image.new("RGBA", image2.rotate(-45, expand=False).size, (0, 0, 0, 0)).width
            - image2.rotate(-45, expand=False).width
        )
        // 2,
        (
            Image.new(
                "RGBA", image2.rotate(-45, expand=False).size, (0, 0, 0, 0)
            ).height
            - image2.rotate(-45, expand=False).height
        )
        // 2,
    )

    try:
        datas = newImg.getdata()
        datasMask = centered_image.getdata()
        new_data = []
        for i, item in enumerate(datas):
            if item[3] <= 255 and item[3] > 0 and datasMask[i][3] > 0:
                new_data.append((item[0], item[1], item[2], 255))
            else:
                if item[3] == 0 and datasMask[i][3] > 0:
                    new_data.append(
                        (
                            datasMask[i][0],
                            datasMask[i][1],
                            datasMask[i][2],
                            datasMask[i][3],
                        )
                    )
                else:
                    new_data.append((item[0], item[1], item[2], 0))
        newImg.putdata(new_data)
    except:
        print("Error making all pixels opaque")
    try:
        datas = newImg.getdata()
        base_r, base_g, base_b = colors.to_rgb(base_color)
        new_data = []
        for item in datas:
            if item[3] > 0:
                new_data.append(
                    (
                        floor(((base_r * 255) + (1 * item[0])) / 2),
                        floor(((base_g * 255) + (1 * item[1])) / 2),
                        floor(((base_b * 255) + (1 * item[2])) / 2),
                        item[3],
                    )
                )
            else:
                new_data.append(item)
        newImg.putdata(new_data)
    except Exception as e:
        print("Invalid color: " + base_color)
        print(e)

    return newImg


def encode_image(image):
    texture: list[int] = []
    for x in range(16):
        for y in range(16):
            red, green, blue, alpha = image.getpixel((y, x))
            if alpha < 10:
                texture.append(-1)
                continue
            rgb = red
            rgb = (rgb << 8) + green
            rgb = (rgb << 8) + blue
            texture.append(rgb)
    encoded_data = b64encode(struct.pack(">{}i".format(len(texture)), *texture)).decode(
        "utf-8"
    )
    return encoded_data


@app.route("/generate", methods=["GET"])
def generate():
    print(request.full_path)
    description = request.args.get("itemDescription")
    color = request.args.get("itemColor")

    closest_item_match, closest_item_match_index = find_closest_match(
        description, item_descriptions
    )
    closest_block_match, closest_block_match_index = find_closest_match(
        description, block_descriptions
    )
    print("Closest matching item description: " + closest_item_match)
    print("Closest matching block description: " + closest_block_match)

    item_image_data = b64decode(dataset["Items"][closest_item_match_index]["image"])
    block_image_data = b64decode(dataset["Blocks"][closest_block_match_index]["image"])

    with Image.open(io.BytesIO(item_image_data)) as img1:
        with Image.open(io.BytesIO(block_image_data)) as img2:
            texture_result = process_image(img1, img2, color)
            return {"success": True, "image": encode_image(texture_result)}


if __name__ == "__main__":
    app.run(host="0.0.0.0", port=17707)
